import React from "react";
import OptionalDiv, { PasswordTextFieldInput, EmailTextFieldInput, SignInButton, CreateAccountWhiteBg} from "./SignInComponents";



const mainDivStyle = {
  width: "500px",
  alignItems: "center",
  justifyContent: "center",
  padding: "40px",
  border: "1px solid gray",
  borderRadius: "20px",
};

function SignInForm() {
  return (
    <form style={mainDivStyle}>
      <p style={{ fontSize: "25px" }}>
        <b>Sign In to ServiceHub</b>
      </p>

      <EmailTextFieldInput error="false" />

      <PasswordTextFieldInput />

      <div
        style={{
          width: "410px",
          display: "flex",
          justifyContent: "flex-end",
          padding: "0px 0px 5px 0px",
        }}
      >
        <p>Forgot Password?</p>
      </div>

      <span style={{ padding: "30px" }}></span>

      <SignInButton />

      <OptionalDiv />

      <span style={{ padding: "30px" }}></span>

      <CreateAccountWhiteBg />

      <span style={{ padding: "30px" }}></span>
    </form>
  );
}

export default SignInForm;
